package main

import (
	"fmt"
	"slices"
)

func lengthOfLongestSubstring(s string) int {
	recordMap := make(map[string]int)

	chars := []rune(s)

	var longest []rune
	current := make([]rune, 0, len(chars))

	for i := 0; i < len(chars); i++ {
		char := chars[i]
		charStr := string(char)

		if j, ok := recordMap[charStr]; ok {
			// encountered repeating character
			if j == i-1 {
				// repeating characters are next to each other
				if len(current) > len(longest) {
					// interrupting the current slice, starting a new slice
					longest = current
				}

				current = make([]rune, 0, len(chars))

				recordMap = make(map[string]int) // reset record map since we start to record a new substring

			} else {
				// repeating characters are not next to each other
				if len(current) > len(longest) {
					longest = current
				}

				current = make([]rune, 0, len(chars))
				current = chars[j+1 : i]

				charsToDelete := chars[:j+1]
				// update record map
				for _, c := range charsToDelete {

					// do not delete character contains in recordMap
					if !slices.Contains(current, c) {
						delete(recordMap, string(c))
					}
				}
			}

			current = append(current, char)

			// update stored character's index
			recordMap[charStr] = i

		} else {
			// never seen this character before
			recordMap[charStr] = i
			current = append(current, char)
		}
	}

	if len(current) > len(longest) {
		longest = current
	}

	fmt.Printf("'%s'\n", string(longest))

	return len(longest)
}

